Ирландский паб «Дублин» рад представить вам мобильное приложение, которое:
-Всегда позволит видеть наше актуальное меню с актуальными ценами;
-Даст возможность сделать заказ не дожидаясь официанта (Для этого нужно иметь QR код с номером вашего заказа);
-Если официант все-таки нужен, то его очень легко позвать прямо из этого мобильного приложения;
-Будет держать вас в курсе о наших акциях и последних новостях.
У каждого из нас есть места, куда мы хотим вернуться. Мы постарались сделать так, чтобы вам всегда хотелось вернуться в паб «Дублин».
